import React, { Component } from "react";
import "./bloodbank.css";

class BloodbankACard extends Component {
  render() {
    return (
      <div className="card" style="width: 18rem;">
        <table className="car-table table">
          <tbody></tbody>
        </table>
        <tr>
          <td>FFP A Rh P(0+): {this.props.ffp_Apos}</td>
          <td>FFP A Rh N(0-): {this.props.ffp_Aneg}</td>
          <td>PC A Rh P(0+): {this.props.pc_Apos}</td>
          <td>PC A Rh N(0-): {this.props.pc_Aneg}</td>
        </tr>
      </div>
    );
  }
}

export default BloodbankACard;
